import React from 'react';

const WindSwitch = ({ video }) => {

    return (
        <td>
            <table className="ui two very basic column table">
                <tbody>
                    < td >
                        <input
                            type="radio"
                            checked="checked"
                        />
                        <label>On</label>
                    </td >
                    <td>
                        <input
                            type="radio"
                            checked="unchecked"
                        />
                        <label>Off</label>
                    </td>
                </tbody>
            </table >
        </td>
    );
};

export default WindSwitch;
